,Click to share on Telegram (Opens in new window),August 18, 2015 |¬† THE HANS INDIA,on,.,Loading...,Like,Like this:,Click to share on LinkedIn (Opens in new window),Vellore:,Engineering,Click to share on LinkedIn Group (Opens in new window),In addition, he has been awarded full-funding, under the aegis of the Cambridge International Scholarship. ‚ÄúLimited students from around the globe are selected for this scholarship with only a small proportion awarded to engineering students and thousands of applications were made which included the IITs-but it was Akshath they chose,‚Äù says Dr. Satyajit Ghosh, Sr. Professor at VIT University. This is a not only a first for VIT University, it is a spectacular achievement by any standards. ‚Äì,Akshath Sharma,Click to share on Pocket (Opens in new window),Click to share on Twitter (Opens in new window),Tags:,Rate this:,Click to share on Skype (Opens in new window),Click to share on WhatsApp (Opens in new window),18/08/2015,Click to share on Pinterest (Opens in new window),Engineering Education,Share this to those who will benefit from the information:,Engineering college,Click to print (Opens in new window),Awards,in,Click to email this to a friend (Opens in new window),Cambridge International Scholarship,By,Click to share on Tumblr (Opens in new window),VIT University student, Akshath Sharma, is the only student from the country to bag the prestigious Cambridge International Scholarship. He has been offered to complete a direct PhD in Mechanical Engineering at the University Of Cambridge in UK, starting this Michaelmas Term 2015.¬† ‚ÄúIt is offered to approximately 80 students selected according to academic merit from all the departments at Cambridge,‚Äù says Sharma. He is the only Indian to have been inducted directly after his B.Tech, with Master‚Äôs requirement waived. Akshath, has secured 2nd Rank in B.Tech Mechanical Engineering programme this year with a CGPA of 9.64.,mbcet,Engineering Research,Vellore Institute of Technology University,Related,Courtesy,,,Indian,|,__ATA.cmd.push(function() {
